    super(props);
    this.state = {};
  }

  componentDidMount() {
    if(this.props.user !== null) this.props.history.push('/zappo/orders')
  }


  render() {

    return (
      <StaffLogin {...this.props} />
    );
  }
}

export default ContStaffLogin;
